DROP TABLE IF EXISTS `tb_meeting`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `tb_meeting` (
  `meeting_seq` int NOT NULL AUTO_INCREMENT,
  `host_seq` int NOT NULL,
  `category_seq` int NOT NULL,
  `meeting_title` varchar(50) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `meeting_desc` text CHARACTER SET utf8 COLLATE utf8_bin,
  `meeting_img` varchar(1000) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL,
  `meeting_capacity` tinyint NOT NULL DEFAULT '12' COMMENT '사용자 입력 X',
  `meeting_headcount` tinyint NOT NULL DEFAULT '0',
  `meeting_url` varchar(1000) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL,
  `meeting_cam_type` tinyint NOT NULL DEFAULT '0' COMMENT 'X/얼굴/손/노캠',
  `meeting_mic_type` tinyint NOT NULL DEFAULT '0' COMMENT 'X/음소거/소음',
  `is_meeting_onair` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`meeting_seq`),
  KEY `FK_tb_user_TO_tb_meeting_1` (`host_seq`),
  KEY `FK_tb_category_TO_tb_meeting_1` (`category_seq`),
  CONSTRAINT `FK_tb_category_TO_tb_meeting_1` FOREIGN KEY (`category_seq`) REFERENCES `tb_category` (`category_seq`),
  CONSTRAINT `FK_tb_user_TO_tb_meeting_1` FOREIGN KEY (`host_seq`) REFERENCES `tb_user` (`user_seq`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb3 COLLATE=utf8_bin;
