usantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, sed quia consequuntur magni dolores eos qui ratione voluptatem sequi nesciunt. Neque porro quisquam est, qui dolorem ipsum quia dolor sit amet, consectetur, adipisci velit, sed quia non numquam eius modi tempora incidunt ut labore et dolore magnam aliquam quaer',6,'슈퍼와플 베이킹 스터디61',10,NULL,NULL,'2022-02-18','2022-02-26',1,0),(96,60,7,'개발 공부 인증 스터디','매일 공부한 것을 인증하고, 칭찬하고, 피드백하는 스터디','스터디 방식\n\n- 월 : 일주일 공부 계획 공유 및 지난 공부 자료 공유\n\n- 화 : CS공부\n\n- 목 : 알고리즘 공부\n\n공부한 자료 및 회고록은 노션 공유 페이지에 작성할 예정입니다. 템플릿은 스터디장이 제공합니다.\n\n\n서로의 공부 자료 및 회고록에 칭찬과 피드백 댓글을 마구 달아주면 그달 스터디는 끝',6,'개발 공부 인증 스터디60',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(97,59,1,'춘식쓰와 함께 하는 요리 스터디~','맛있는 요리 만들어봐요!! :)','같이 요리 공부하고, 맛있는 요리 하실 분들을 찾습니다 :)\n주말 전인 금요일과 주말 중 토요일 저녁 시간에 함께 요리하는 시간 가졌으면 좋겠습니다 ㅎㅎ\n\n요리 못하는거 상관 없습니다, 레시피도 같이 공유하고, 함께 요리하는 모습 공유하면서 맛있게 만들어봐요 ㅎㅎ\n\n매 주 금, 토 다 출석하지 않으셔도 됩니다. 인원 찰때까지 받겠습니다. :)\n\n관심 있으신 분들은 신청 눌러주세요!! ㅎㅎ',6,'Study97hst59linkURL',10,'2022-02-18',NULL,'2022-02-18','2022-02-26',1,0),(98,60,7,'프론트엔드 스터디','리액트를 공부해보아요','프론트엔드 개발자로 취업하기 위한 스터디입니다.\n기초적인것 부터 프로젝트 진행까지..!\n\ncss다루기, react 훅 사용 등 프론트엔드의 전반적인 부분을 공부하는 스터디입니다\n스터디시간에 같이 개발을 하며 개발 실력을 향상시켜 보아요',6,'프론트엔드 스터디60',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(99,1,3,'실무 포토샵 일러스트 디자인 or 마케팅 스터디','레벨별 자신의 작업에 맞춰 진행하는 디자인/마케팅스터디!','디자이너에게 실무스킬로 끝내는 기초 포토샵/일러스트 작업부터\n취업과 스킬업에 필요한 작업까지 수준별로 함께해요!\n\n실무 마케팅 부터 디자인팀까지 모두 준비 가능!\n\"겉 핡기 식이 아닌 스스로 디자인할 수 있는 방법을 스터디로 배워요.\"\n\n\n1) 포토샵/일러스트를 처음배우는 기초분들을 위한 레벨로 4주동안 기초완성하며 프로그램툴과  디자인 발상법으로 기획부터 스스로 작업할수 있는환경을 만들며 스터디를 진행합니다.\n2) 스킬업 단계로 심화 스킬을 배우며 학생 개인커리큘럼에 맞춰진 디자인작업을 진행해 스스로 디자인 할 수 있는 스터디를 진행합니다.\n\n\n\n',6,'실무 포토샵 일러스트 디자인 or 마케팅 스터디1',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(100,62,4,'공기업 전공 스터디','공기업에서 시행 중인 NCS(직업기초능력평가) 및 전공시험(경영/경제)을 준비','이번년도 하반기를 비롯하여 내년 상반기까지 공기업을 준비하는 과정에서 효율적인 전공공부를 하고자 합니다\n주요 공기업에서 시행 중인 NCS(직업기초능력평가) 및 전공시험(경영/경제)을 준비하고자 합니다\n현재 공기업 재직 중이나, 이직 준비를 하는 과정에서 다른 분들과 공부 계획을 공유함과 동시에 진도 체크를 하면서 \'강제성\'을 두기 위함에 있습니다\n\n스터디원들끼리 주간 공부계획을 공유하고, 일일 단위로 얼마나 공부했는지 점검하며 하루를 마무리하고자 해요!\n\n경영 혹은 경제영역에 대한 탭을 따로 두어, 준비하는 인원들끼리 문제 공유\n\n - 경영학/경제학에 대한 문제를 한 명씩 돌아가며 발제하고, 이를 공유하며 스터디원들끼리 해설 풀이\n\n - 밴드(BAND)앱을 활용하여 경영학/경제학 탭에 문제를 업로드하는 방식\n\n - 출제하는 문제 유형은 객관식, O/X문제, 단답형, 약술형 등 다양한 방식으로 지정\n\n\n\n',6,'Study100hst62linkURL',10,'2022-02-18',NULL,'2022-02-18','2022-02-25',1,0),(101,63,1,'건강 챙길 나이, 스물여섯','건강한 식사를 꿈꿉니다.','배달음식에 지친 영혼들을 위로하기 위해 간단한 재료로 직접 만들 수 있는 요리들을 소개합니다~!',6,'Study101hst63linkURL',10,'2022-02-18',NULL,'2022-02-18','2022-02-25',1,0),(102,62,3,'삼성 취업 스터디','오직 삼성그룹만 판다!','삼성 스터디와 함께 최종합격합시다!',6,'삼성 취업 스터디62',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(103,62,5,'컴활 1급 실기 고수 구합니다.','컴활 1급 실기 가르쳐주실 분???','금요일 13~15시, 주말 10~12시 스터디 구합니다!! 고수님들 환영해요★',6,'컴활 1급 실기 고수 구합니다.62',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(104,1,8,'기타초급반','기타배우고싶으신분들 환영','기타를 배워보아요 \n1. 코드외우기\n2. 기초곡 연습\n3. 연주하고싶은곡 연습',6,'기타초급반1',10,NULL,NULL,'2022-02-18','2022-03-05',1,0),(105,1,4,'공기업 인적성 스터디 상/하반기 경험자만','공기업 NCS 인적성 스터디','봉투모의고사 문제풀이로 각자 스킬 공유로 시험 감을 잃지 마세요~!\n\n벌금은 없으나 참여율을 높게 하기 위하여 \n\n한달치 비용을 전부 지불하고 결석 및 지각에 대한 환불은 안되게 운영하고 있습니다.\n\n착실하게 출석하셔서 공부하실 분들 급구합니다~!\n\n\n',6,'공기업 인적성 스터디 상/하반기 경험자만1',10,NULL,NULL,'2022-02-18','2022-02-20',1,0),(106,60,9,'특수교육 임용공부해요','특수교육과 임용 준비','이번임용에 꼭 붙읍시다',6,'특수교육 임용공부해요60',10,NULL,NULL,'2022-02-18','2022-03-02',1,0),(107,63,2,'재수합니다','...','같이 공부하고 서로서로 모르는 부분 물어보며 진행하고 싶습니다.\n주말 제외, 매일 09-22시 공부합니다. 주말에 공부하고 싶으신 분들은 제 자유열람실로 찾아오세요',6,'재수합니다63',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(108,64,1,'백주부레시피 따라하기','백주부 유튜브를 보며 요리를만들어보아요','백주부 레시피로 간단한 요리를 만들며 요리실력을 향상시켜 봅시다',6,'백주부레시피 따라하기64',10,NULL,NULL,'2022-02-18','2022-02-25',1,0),(109,62,7,'SQLD 자격증 취득','한 달 뽀개기!!!!!!!','SQLD 같이 공부해도 되고, 헷갈리는 부분 서로 질문하는 시간 가져요~ 다들 화이팅합시다!!!',6,'Study109hst62linkURL',10,'2022-02-18',NULL,'20